import React from "react";
import { Link } from "react-router-dom";
import "./Blog.css";

const Blog = () => {
  const blogCategories = [
    { name: "Nutritional Food", path: "/blog/nutritional-food" },
    { name: "Do's and Don'ts", path: "/blog/dos-and-donts" },
    { name: "Health and Hygiene", path: "/blog/health-and-hygiene" },
    { name: "Play and Learning", path: "/blog/play-and-learning" },
    { name: "Parenting Tips", path: "/blog/parenting-tips" },
  ];

  return (
    <div className="blog-container">
      <h1>Explore Blog Categories</h1>
      <p>Browse through various blog topics tailored for infant care and parenting.</p>
      <ul>
        {blogCategories.map((category, index) => (
          <li key={index}>
            <Link to={category.path}>{category.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Blog;
